func abbreviation(a string, b string) string {
	if isTransformable(a, b) {
		return "YES"
	}
	return "NO"
}

func isTransformable(a string, b string) bool {
	dpSlice := [][]bool{}
	runesA := []rune(a)
	runesB := []rune(b)

	if len(b) == 0 {
		dpSlice = append(dpSlice, []bool{true})

		containsUppercase := false

		for i := 1; i <= len(a); i++ {
			k := i - 1

			if (int(runesA[k]) >= 65 && int(runesA[k]) <= 90) || containsUppercase {
				containsUppercase = true
				dpSlice[0] = append(dpSlice[0], false)
			} else {
				dpSlice[0] = append(dpSlice[0], true)
			}
		}

		return dpSlice[0][len(a)]
	}

	uppercase := false
	dpSlice = append(dpSlice, []bool{true})

	for i := 0; i < len(b); i++ {
		dpSlice[0] = append(dpSlice[0], false)
	}

	for i := 0; i < len(a); i++ {
		if (int(runesA[i]) >= 65 && int(runesA[i]) <= 90) || uppercase {
			dpSlice = append(dpSlice, []bool{false})
			uppercase = true
		} else {
			dpSlice = append(dpSlice, []bool{true})
		}
	}

	for i := 1; i <= len(a); i++ {
		for j := 1; j <= len(b); j++ {
			if int(runesA[i-1]) == int(runesB[j-1]) {
				dpSlice[i] = append(dpSlice[i], dpSlice[i-1][j-1])
			} else if int(runesA[i-1])-32 == int(runesB[j-1]) {
				dpSlice[i] = append(dpSlice[i], dpSlice[i-1][j-1] || dpSlice[i-1][j])
			} else if int(runesA[i-1]) >= 65 && int(runesA[i-1]) <= 90 {
				dpSlice[i] = append(dpSlice[i], false)
			} else {
				dpSlice[i] = append(dpSlice[i], dpSlice[i-1][j])
			}

		}
	}

	return dpSlice[len(a)][len(b)]
}
